/* eslint-disable */
import React from "react";
import { Link } from "react-router-dom";

export default function IndexNavbar() {
  const [navbarOpen, setNavbarOpen] = React.useState(false);

  return (
    <>
      <nav className="top-0 fixed z-50 w-full flex flex-wrap items-center justify-between px-4 py-3 navbar-expand-lg bg-blue-800 shadow">
        <div className="container mx-auto flex flex-wrap items-center justify-between">
          {/* Logo + Etudia */}
          <Link to="/" className="flex items-center space-x-2">
            <img
              src={require("assets/img/etudia-logo.png").default}
              alt="Logo Etudia"
              className="h-8 w-auto"
            />
            <span className="text-white text-lg font-bold leading-relaxed whitespace-nowrap">
              Etudia
            </span>
          </Link>

          {/* Bouton Ã  droite */}
          <div className="flex items-center">
            <Link
              to="/auth/login"
              className="flex items-center space-x-2 bg-gradient-to-r from-purple-500 to-pink-500 text-white font-semibold px-4 py-2 rounded shadow hover:shadow-lg transition-all duration-150 text-sm"
            >
              <i className="fas fa-user text-base" />
              <span>S'identifier / S'enregistrer</span>
            </Link>
          </div>
        </div>
      </nav>
    </>
  );
}
